ct the customer after checkout. This could be, for example, a link to the payment processors website.'=>'URL za preusmjeravanje kupca nakon odjave. To bi mogla biti, na primjer, veza do web stranice obrađivača plaćanja.','The coupons unique code.'=>'Jedinstveni kod kupona.','Total amounts provided using the smallest unit of the currency.'=>'Ukupni iznosi osigurani korištenjem najmanje jedinice valute.','Total discount applied by this coupon.'=>'Ukupni popust primjenjen ovim kuponom.','Total tax removed due to discount applied by this coupon.'=>'Ukupni porez uklonjen zbog popusta primjenjenog ovim kuponom.','Currency symbol for the currency which can be used to format returned prices.'=>'Simbol valute za valutu koja se može koristiti za formatiranje vraćenih cijena.','Currency minor unit (number of digits after the decimal separator) for returned prices.'=>'Manje jedinice u valuti (broj cifara nakon decimalnog separatora) za vraćene cijene.','Decimal separator for the currency which can be used to format returned prices.'=>'Decimalni separator za valutu koji se koristi za formatiranje vraćenih cijena.','Thousand separator for the currency which can be used to format returned prices.'=>'Separator hiljadu za valutu koja se može koristiti za formatiranje vraćenih cijena.','Price prefix for the currency which can be used to format returned prices.'=>'Prefiks cijene za valutu koja se može koristiti za formatiranje vraćenih cijena.','Apartment, suite, etc.'=>'Stan, apartman, itd.','%1$s requires an instance of %2$s or %3$s for the address'=>'%1$s zahtijeva instancu %2$s ili %3$s za adresu','Returns number of products within attribute terms.'=>'Vraća broj proizvoda u okviru atributa.','Min and max prices found in collection of products, provided using the smallest unit of the currency.'=>'Minimalne i maksimalne cijene koje se nalaze u kolekciji proizvoda, pod uvjetom da se koristi najmanja jedinica valute.','Category image.'=>'Slika kategorije.','Number of reviews for products in this category.'=>'Broj recenzija za proizvode iz ove kategorije.','List of available shipping rates for the cart.'=>'Popis dostupnih cijena dostave za korpu.','List of applied cart coupons.'=>'Popis primijenjenih kupona za korpu.','True if the cart needs payment. False for carts with only free products and no shipping costs.'=>'Tačno ako je korpi potrebno plaćanje. Netačno za korpu sa samo besplatnim proizvodima i bez troškova dostave.','Total price of items in the cart.'=>'Ukupna cijena artikala u korpi.','Total tax on fees.'=>'Ukupni porez na naknade.','Total price of any applied fees.'=>'Ukupna cijena svih primijenjenih naknada.','Total discount from applied coupons.'=>'Ukupni popust od primijenjenih kupona.','Total tax removed due to discount from applied coupons.'=>'Ukupni porez uklonjen zbog popusta na primijenjene kupone.','Total price of shipping.'=>'Ukupna cijena dostave.','Total price the customer will pay.'=>'Ukupna cijena koju će kupac platiti.','Total tax applied to items and shipping.'=>'Ukupni porez koji se primjenjuje na artikle i dostavu.','Lines of taxes applied to items and shipping.'=>'Redovi poreza koji se primjenjuju na artikle i dostavu.','The name of the tax.'=>'Ime poreza.','The amount of tax charged.'=>'Iznos obračunatog poreza.','List of cart item errors, for example, items in the cart which are out of stock.'=>'Lista grešaka u korpi, na primjer, artikli u korpi kojih nema na zalihama.','Name of the package.'=>'Ime paketa.','Shipping destination address.'=>'Adresa odredišta dostave.','Name of the item.'=>'Ime artikla.','Quantity of the item in the current package.'=>'Količina artikla u trenutnom paketu.','ID of the shipping rate.'=>'ID cijene dostave.','List of cart items the returned shipping rates apply to.'=>'Popis predmeta u korpi na koje se odnose cijene vraćanja.','Delivery time estimate text, e.g. 3-5 business days.'=>'Tekst procjene vremena dostave, npr. 3-5 radnih dana.','Error message'=>'Poruka o grešci','Current set shipping address for the customer.'=>'Trenutno postavljena adresa za dostavu kupca.','Cart total amounts provided using the smallest unit of the currency.'=>'Ukupni iznosi korpe osigurani korištenjem najmanje jedinice valute.','Total tax on items in the cart.'=>'Ukupni porez na artikle u korpi.','List of shipping rates.'=>'Popis cijena dostave.','The ID of the package the shipping rates belong to.'=>'ID paketa kojem pripadaju cijene dostave.','Description of the shipping rate, e.g. Dispatched via USPS.'=>'Opis cijene dostave, npr. Slanje putem USPS-a.','Name of the shipping rate, e.g. Express shipping.'=>'Naziv cijene dostave, npr. Express dostava.','Price of this shipping rate using the smallest unit of the currency.'=>'Vrijednost stope dostave koristeći najmanju jedinicu valute.','ID of the shipping method that provided the rate.'=>'ID načina dostave koji je odredio cijenu.','State/County code, or name of the state, county, province, or district.'=>'Kod države/okruga ili naziv države, okruga, provincije ili distrikta.','Country/Region code in ISO 3166-1 alpha-2 format.'=>'Kod države/regije u ISO 3166-1 alfa-2 formatu.','Currency code (in ISO format) for returned prices.'=>'Kôd valute (u ISO formatu) za vraćene cijene.','Error code'=>'Kôd greške','"%s" has already been applied and cannot be used in conjunction with other coupons.'=>'"%s" je već primijenjen i ne može se koristiti zajedno s ostalim kuponima.','Second line of the address being shipped to.'=>'Drugi red adrese na koju se šalje.','City of the address being shipped to.'=>'Grad adrese na koju se dostavlja.','Unique identifier for the coupon within the cart.'=>'Jedinstveni identifikator kupona u korpi.','Coupons are disabled.'=>'Kuponi su onemogućeni.','Invalid coupon code.'=>'Nevažeći kod kupona.','Coupon cannot be removed because it is not already applied to the cart.'=>'Kupon se ne može ukloniti jer nije već primijenjen u korpi.','Coupon does not exist in the cart.'=>'Kupon ne postoji u korpi.','Sort ascending or descending.'=>'Poredaj uzlazno ili silazno.','Sort by term property.'=>'Poredaj po terminu svojstva.','If true, empty terms will not be returned.'=>'Ako je istina, prazni izrazi se neće vratiti.','Unique identifier (key) for the cart item.'=>'Jedinstveni identifikator (ključ) za korpu.','Cart item no longer exists or is invalid.'=>'Artikal u korpi više ne postoji ili nije važeći.','Data to pass through to the payment method when processing payment.'=>'Podaci koji se prosljeđuju načinu plaćanja prilikom obrade plaćanja.','Invalid payment result received from payment method.'=>'Nevažeći rezultat plaćanja primljen od načina plaćanja.','No payment method provided.'=>'Nije omogućen način plaćanja.','Unique identifier (key) for the cart item to update.'=>'Jedinstveni identifikator (ključ) za ažuriranje proizvoda u korpi.','New quantity of the item in the cart.'=>'Nova količina artikla u korpi.','Method not implemented'=>'Metoda nije implementirana','Limit result set to reviews from specific category IDs.'=>'Ograniči rezultat postavljen na recenzije iz određenih ID-ova kategorija.','Limit result set to reviews from specific product IDs.'=>'Ograničite skup rezultata na recenzije određenih ID-ova proizvoda.','The chosen rate ID for the package.'=>'Odabrani ID cijene za paket.','Invalid coupons were removed from the cart: "%s"'=>'Nevažeći kuponi uklonjeni su iz korpe: "%s"','Cannot create order from empty cart.'=>'Narudžba se ne može napraviti iz prazne korpe.','Cart item is invalid.'=>'Artikal korpe nije validan.','"%s" is an invalid coupon code.'=>'"%s" je nevažeći kod kupona.','Coupon code "%s" has already been applied.'=>'Kod kupona "%s" je već primijenjen.','Zip or Postcode of the address being shipped to.'=>'Poštanski broj adrese na koju se šalje.','ISO code for the country of the address being shipped to.'=>'ISO kod za zemlju adrese za koju se šalje.','Limit result set to products based on a minimum price, provided using the smallest unit of the currency.'=>'Ograničeni rezultat postavljen je na proizvode temeljene na minimalnoj cijeni, pod uvjetom da se koristi najmanja jedinica valute.','Limit result set to products based on a maximum price, provided using the smallest unit of the currency.'=>'Ograničeni rezultat postavljen je na proizvode temeljene na maksimalnoj cijeni, pod uvjetom da se koristi najmanja jedinica valute.','First line of the address being shipped to.'=>'Prva linija adrese na koju se šalje.','The "%1$s" coupon has been removed from your cart: %2$s'=>'Kupon "%1$s" je uklonjen iz vaše korpe: %2$s','&quot;%s&quot; is not available for purchase.'=>'&quot;%s&quot; nije dostupan za kupovinu.','ID of the parent product, if applicable.'=>'ID matičnog proizvoda, ako je primjenjivo.','Product short description in HTML format.'=>'Kratak opis proizvoda u HTML formatu.','Product full description in HTML format.'=>'Puni opis proizvoda u HTML formatu.','Price data provided using the smallest unit of the currency.'=>'Podaci o cijenama dobijeni s najmanjom jedinicom valute.','List of variation IDs, if applicable.'=>'Popis ID-ova varijacije, ako je primjenjivo.','Quantity left in stock if stock is low, or null if not applicable.'=>'Količina ostavljena na zalihi ako je zaliha mala, ili nula ako nije primjenjiva.','Parent term ID, if applicable.'=>'ID roditelja, ako je primjenjivo.','The order ID to process during checkout.'=>'ID narudžbe za obradu tokom plaćanja.','Order status. Payment providers will update this value after payment.'=>'Stanje narudžbe. Davatelji plaćanja ažurirat će ovu vrijednost nakon uplate.','Order key used to check validity or protect access to certain order data.'=>'Tipka za narudžbu koja se koristi za provjeru valjanosti ili zaštitu pristupa određenim podacima narudžbe.','Note added to the order by the customer during checkout.'=>'Napomena koju je kupac dodao prilikom narudžbe.','Customer ID if registered. Will return 0 for guests.'=>'ID kupca ako je registrovan. Vratit će 0 za goste.','ISO code, or name, for the state, province, or district of the address being shipped to.'=>'ISO kod, ili naziv, za državu, pokrajinu ili distrikt adrese do koje se šalje.','Price string formatted as HTML.'=>'Niz cijena oblikovan kao HTML.','Verifying database... One or more tables are still missing: '=>'Provjera baze podataka ... Još uvijek nedostaju jedna ili više tabela:','Database verified successfully.'=>'Baza podataka uspješno je verifikovana.','You need WooCommerce 4.2 or newer to run this tool.'=>'Za pokretanje ovog alata potreban vam je WooCommerce 4.2 ili noviji.','The active version of WooCommerce does not support template cache clearing.'=>'Aktivna verzija WooCommercea ne podržava brisanje keša predloška.','Template cache cleared.'=>'Keš predloška očišćen.','Verify if all base database tables are present.'=>'Provjerite postoje li sve tabele baze podataka.','Verify database'=>'Provjerite bazu podataka','Verify base database tables'=>'Provjerite tabele baza podataka','This tool will empty the template cache.'=>'Ovaj alat će isprazniti keš predloška.','Clear template cache'=>'Izbriši keš predloška','If your store is based in the EU, we recommend using the EU VAT Number extension in addition to automated taxes. It provides your checkout with a field to collect and validate a customer\'s EU VAT number, if they have one.'=>'Ako je vaša trgovina sa sjedištem u EU, preporučujemo vam da uz automatizirane poreze koristite i proširenje EU PDV broja. Omogućuje vašoj blagajni polje za prikupljanje i ovjeru kupca EU PDV broja, ako ga ima.','Collect and validate EU VAT numbers at checkout'=>'Prikupite i potvrdite EU PDV brojeve na blagajni','Get real-time order alerts anywhere'=>'Dobijajte upozorenja o narudžbi u stvarnom vremenu bilo gdje','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.'=>'Dobijte obavijesti o aktivnosti trgovine, uključujući nove narudžbe i preglede proizvoda direktno na svojim mobilnim uređajima pomoću aplikacije Woo.','First order received'=>'Primljena prva narudžba','Invalid category ID.'=>'Nevažeći ID kategorije.','WooCommerce %1$s table creation failed. Does the %2$s user have CREATE privileges on the %3$s database?'=>'Izrada WooCommerce tabele %1$s nije uspjela. Ima li korisnik %2$s KREIRAJ povlastice u bazi podataka %3$s?','Maximum number of items to be returned in result set. Defaults to no limit if left blank.'=>'Maksimalni broj artikala koji se vraćaju u skupu rezultata. Ne podrazumijeva se bez ograničenja ako je prazno.','The admin note layout has a wrong prop value.'=>'Izgled administrativne bilješke ima pogrešnu vrijednost.','Start your online clothing store'=>'Pokrenite svoju internetsku trgovinu odjeće','Starting a fashion website is exciting but it may seem overwhelming as well. In this article, we\'ll walk you through the setup process, teach you to create successful product listings, and show you how to market to your ideal audience.'=>'Pokretanje modne web stranice je uzbudljivo, ali može se činiti i neodoljivim. U ovom ćemo članku provesti vas kroz postupak postavljanja, naučiti vas da kreirate uspješne liste proizvoda i pokazati vam kako tržišno predstavljati svojoj idealnoj publici.','Do you need help with adding your first product?'=>'Treba li vam pomoć oko dodavanja vašeg prvog proizvoda?','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'Ovaj će vam video vodič pomoći da prođete kroz postupak dodavanja svog prvog proizvoda u WooCommerce.','Now that you’ve chosen us as a partner, our goal is to make sure we\'re providing the right tools to meet your needs. We\'re looking forward to having your feedback on the store setup experience so we can improve it in the future.'=>'Sada kada ste nas odabrali za partnera, naš je cilj osigurati pružanje pravih alata za ispunjavanje vaših potreba. Radujemo se što ćemo dobiti vaše mišljenje o iskustvu postavljanja trgovine da bismo ga mogli poboljšati u budućnosti.','Share feedback'=>'Podijelite povratne informacije','Watch tutorial'=>'Pogledajte tutorijal','Changing eCommerce platforms might seem like a big hurdle to overcome, but it is easier than you might think to move your products, customers, and orders to WooCommerce. This article will help you with going through this process.'=>'Promjena platforme za e-trgovinu može se činiti kao velika prepreka koju treba prevladati, ali lakše je nego što možda mislite premjestiti svoje proizvode, kupce i narudžbe na WooCommerce. Ovaj će vam članak pomoći da prođete kroz ovaj postupak.','WooCommerce Subscriptions allows you to introduce a variety of subscriptions for physical or virtual products and services. Create product-of-the-month clubs, weekly service subscriptions or even yearly software billing packages. Add sign-up fees, offer free trials, or set expiration periods.'=>'WooCommerce pretplate omogućuju vam uvođenje različitih pretplata na fizičke ili virtualne proizvode i usluge. Kreirajte klubove sa proizvodima za mjesec dana, pretplate na sedmične usluge ili čak godišnje pakete za naplatu softvera. Dodajte naknade za prijavu, nudite besplatne probne verzije ili postavite termin isteka.','Do you want to migrate from Shopify to WooCommerce?'=>'Želite li preći s Shopify na WooCommerce?','Kajiado'=>'Kajiado','Kakamega'=>'Kakamega','Kericho'=>'Kericho','Kiambu'=>'Kiambu','Kilifi'=>'Kilifi','Kirinyaga'=>'Kirinyaga','Kisii'=>'Kisii','Kisumu'=>'Kisumu','Kitui'=>'Kitui','Kwale'=>'Kwale','Laikipia'=>'Laikipia','Lamu'=>'Lamu','Machakos'=>'Machakos','Makueni'=>'Makueni','Mandera'=>'Mandera','Marsabit'=>'Marsabit','Meru'=>'Meru','Migori'=>'Migori','Mombasa'=>'Mombasa','Murang’a'=>'Murang’a','Nairobi County'=>'Nairobi okrug','Nakuru'=>'Nakuru','Nandi'=>'Nandi','Nyamira'=>'Nyamira','Narok'=>'Narok','Nyandarua'=>'Nyandarua','Nyeri'=>'Nyeri','Siaya'=>'Siaya','Samburu'=>'Samburu','Tana River'=>'Tana River','Taita-Taveta'=>'Taita-Taveta','Tharaka-Nithi'=>'Th