ful to test purchases.'=>'Plaćanja putem čekova. Ovaj izvanmrežni gateway također može biti koristan za testiranje kupnje.','Account details:'=>'Detalji računa:','Comma-separated list of search stopwords in your languageabout,an,are,as,at,be,by,com,for,from,how,in,is,it,of,on,or,that,the,this,to,was,what,when,where,who,will,with,www'=>'o,an,su,kao,na,biti,po,com,za,od,kako,u,je,to,od,ili,da,to,to,je,šta,kada,gdje,ko,hoće,sa,www','Optionally add some text for the terms checkbox that customers must accept.'=>'Po želji dodajte neki tekst za potvrdno polje za uslove korištenja koje korisnici moraju prihvatiti.','%s page'=>'%s stranica','No page set'=>'Nije postavljena stranica','Highlight required fields with an asterisk'=>'Označi obavezna polja zvjezdicom','I have read and agree to the website %s'=>'Pročitao/la sam i slažem se s %s web stranice.','%s field'=>'polje %s','These options let you change the appearance of the WooCommerce checkout.'=>'Ove vam opcije omogućuju promjenu izgleda WooCommerce stranice naplate.','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'U ovom pododjeljku trebate navesti procesore za plaćanje treće strane koje koristite za plaćanje u vašoj trgovini, jer se ti podaci mogu obrađivati. Na primjer, uključili smo PayPal, ali to biste trebali ukloniti ako ga ne upotrebljavate.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Dijelimo informacije s trećim stranama koje nam pomažu pružati narudžbe i pohranjivati usluge; na primjer --','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'U ovom odjeljku navedite s kim dijelite podatke i za koju svrhu. To može uključivati, ali ne mora biti ograničeno na, analitiku, marketing, gatewaye za plaćanje, davatelje usluga isporuke i ugrađivanje od trećih strana (embeds).','What we share with others'=>'Šta dijelimo s drugima','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Članovi našeg tima imaju pristup ovim informacijama kako bi ispunili narudžbe, obradili povrate i pružali korisničku podršku.','Customer information like your name, email address, and billing and shipping information.'=>'Informacije o kupcima kao što su: vaše ime, adresa e-pošte i informacije o naplati i dostavi.','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Informacije o narudžbi poput onoga što je kupljeno, kada je kupljeno, gdje treba poslati, i','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'Članovi našeg tima imaju pristup informacijama koje nam dajete. Na primjer, administratori i menadžeri trgovine mogu pristupiti:','Who on our team has access'=>'Ko iz našeg tima ima pristup','We will also store comments or reviews, if you choose to leave them.'=>'Također ćemo pohraniti komentare ili recenzije, ako ih odlučite ostaviti.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Obično pohranjujemo informacije o vama dok god trebamo vaše podatke u svrhe za koje ih prikupljamo i upotrebljavamo, a nismo više zakonski obvezni da ih čuvamo. Na primjer, podatke o narudžbi čuvamo 10 godina za porezne i računovodstvene svrhe. To uključuje vaše ime, email adresu i adrese za naplatu i dostavu."','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Ako izradite račun, pohranit ćemo vaše ime, adresu, email adresu i broj telefona, koji će se upotrijebiti za popunjavanje polja naplate prilikom buduće narudžbe.','Send you marketing messages, if you choose to receive them'=>'Slanje marketinških poruka, ako ih odlučite primati','Improve our store offerings'=>'Poboljšajte ponudu vaše trgovine','Comply with any legal obligations we have, such as calculating taxes'=>'Pridržavajte se svih zakonskih obveza koje imate, poput izračuna poreza','Set up your account for our store'=>'Postavite korisnički račun za našu trgovinu','Process payments and prevent fraud'=>'Obrada plaćanja i sprečavanje prevare','Respond to your requests, including refunds and complaints'=>'Odgovorite na zahtjeve, uključujući povrate i prigovore','Send you information about your account and order'=>'Slanje informacija o vašem računu i narudžbi','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Kada kupujete od nas, od vas ćemo tražiti da dajete podatke, uključujući vaše ime, adresu za naplatu, adresu za dostavu, email adresu, broj telefona, podatke o plaćanju i opcionalne podatke o računu kao što su korisničko ime i šifra. Koristit ćemo te podatke za svrhe, kao što su:','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Napomena: preporučujemo dodavanje dodatnih pojedinosti u pravila o kolačićima i povezivanje tog odjeljka odavde.','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'Također ćemo koristiti kolačiće kako bismo pratili sadržaj korpe dok pregledavate našu web stranicu.','Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>'Adresa za dostavu: zatražit ćemo od vas da unesete ovo kako bismo, na primjer, mogli procijeniti cijenu/opciju dostave prije slanja narudžbe i/ili poslati vam narudžbu!','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Lokacija, IP adresa i vrsta pretraživača: koristit ćemo to za svrhe kao što su procjena poreza i dostave','While you visit our site, we’ll track:'=>'Dok pregledavate našu web stranicu, pratit ćemo sljedeće:','What we collect and store'=>'Šta prikupljamo i pohranjujemo','We collect information about you during the checkout process on our store.'=>'Prikupljamo informacije o vama tokom postupka naplate na našoj trgovini.','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Ovaj primjer teksta uključuje osnove oko toga koje lične podatke vaša trgovina može prikupljati, pohranjivati i dijeliti, kao i ko može imati pristup tim podacima. Ovisno o tome koja su podešavanja omogućena i koje dodatne dodatke upotrebljavate, određene informacije koje će dijeliti vaša trgovina razlikuju se. Preporučujemo da se savjetujete s advokatom prilikom odlučivanja o informacijama koje ćete otkriti u vašim pravilima o privatnosti.','Order Number'=>'Broj narudžbe','Access granted'=>'Pristup odobren','Download count'=>'Broj preuzimanja','User email'=>'Email korisnika','Token'=>'Token','Payment Tokens'=>'Tokeni za plaćanje','Browser User Agent'=>'Korisnički Agent pretraživača','Items Purchased'=>'Kupljene stavke','