anje servera)','Suhosin is an advanced protection system for PHP installations. It was designed to protect your servers on the one hand against a number of well known problems in PHP applications and on the other hand against potential unknown vulnerabilities within these applications or the PHP core itself. If enabled on your server, Suhosin may need to be configured to increase its data submission limits.'=>'Suhosin je napredni sustav zaštite za PHP instalacije. To je dizajnirano tako da zaštiti vaše servere s jedne strane od brojnih dobro poznatih problema u PHP aplikacijama a s druge strane protiv potencijalnih nepoznatih ranjivosti unutar tih aplikacija ili u samoj PHP jezgri. Ako je omogućen na vašem poslužitelju, Suhosin možda treba biti konfiguriran da poveća limit dostave podataka.','PHP time limit'=>'PHP Time Limit','The largest filesize that can be contained in one post.'=>'Najveća veličina datoteke koja može biti sadržana u jednoj objavi.','PHP post max size'=>'PHP Post Max Size','The version of PHP installed on your hosting server.'=>'PHP verzija instalirana na vašem hosting serveru.','Information about the web server that is currently hosting your site.'=>'Podaci o web serveru koji trenutno hosta vašu stranicu.','Server environment'=>'Server Okruženje','The current language used by WordPress. Default = English'=>'Trenutni jezik kojeg koristi WordPress. Default = English','Language'=>'Jezik','Displays whether or not WordPress is in Debug Mode.'=>'Prikazuje da li je WordPress u Debug načinu.','The maximum amount of memory (RAM) that your site can use at one time.'=>'Maksimalna količina memorije (RAM-a) koju vaša stranica može koristiti u jednom trenutku.','Whether or not you have WordPress Multisite enabled.'=>'Da li imate omogućen WordPress Multisite.','The version of WordPress installed on your site.'=>'Verzija WooCommerce installiranog na vašoj stranici.','Several WooCommerce extensions can write logs which makes debugging problems easier. The directo